import React from 'react';
import Tilt from 'react-parallax-tilt';
import './Logo.css';
import Brain from './brain.png';
const Logo = () => {
  return (

	    <Tilt style={{ height: '200px', width:'310px', backgroundColor: 'lightorange' }}
	    		className = 'br2 shadow-3 grd'>
	      <div >
	        <img style={{ height: '200px', width:'310px'}} alt = 'logo' src = {Brain}/>
	      </div>
	    </Tilt>

  );
};

export default Logo;
